import React, { useEffect, useState } from 'react';
import axios from 'axios';

const API_URL = "http://localhost:5009/api/company";
const CardObject = ({ objectData, company_id, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchObjectCards = async () => {
      try {
        const response = await axios.post(`${API_URL}/getObjCards`, {
          company_id,
          identifiers,
        });
        setObjectCards(response.data);
      } catch (error) {
        console.log('Ошибка при получении карточек объектов:', error);
      }
    };

    fetchObjectCards();
  }, [companyId, identifiers]);
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">{objectData.name}</h5>
        <p className="card-text">Registry Number: {objectData.registry_number}</p>
        <p className="card-text">Date Entry: {objectData.date_entry}</p>
        <p className="card-text">Kind Object: {objectData.kind_object}</p>
        <p className="card-text">Type Object: {objectData.type_object}</p>
        <p className="card-text">Address: {objectData.address}</p>
        <p className="card-text">Subject RF: {objectData.subject_rf}</p>
        <p className="card-text">Settlement: {objectData.settlement}</p>
        <p className="card-text">Index: {objectData.index}</p>
        <p className="card-text">Basis Inclusion: {objectData.basis_inclusion}</p>
        <p className="card-text">Date Categorization: {objectData.date_categorization}</p>
        <p className="card-text">Category: {objectData.category}</p>
        <p className="card-text">Basis Changes: {objectData.basis_changes}</p>
        <p className="card-text">Date Changes: {objectData.date_changes}</p>
        <p className="card-text">Date Changes Category: {objectData.date_changes_category}</p>
        <p className="card-text">Category Changes: {objectData.category_changes}</p>
        <p className="card-text">Basis Removal: {objectData.basis_removal}</p>
        <p className="card-text">Date Removal: {objectData.date_removal}</p>
      </div>
    </div>
  );
};

export default CardObject;
